Surviving Ebola

Health-Medical Documentary hosted by Shaunagh Connaire, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2014 - English narration


Information
------------------------------

Unreported World reports on the Ebola outbreak devastating Sierra Leone. As the only television crew to spend two weeks embedded in field hospitals and quarantine units, reporter Shaunagh Connaire and director Wael Dabbous provide a unique view of what life is like for the health workers battling the virus and the families affected. The Unreported World team was in Sierra Leone at a critical phase in the summer when there was still a chance to contain the virus. In the time they were there, though, it was clear the battle to contain it was being lost. This Ebola outbreak has claimed nearly 2000 lives. The World Health Organization warns the virus could ultimately infect more than 20,000 people. Without the bravery and determination of those battling the virus, the figures would be far higher.

